INSERT INTO `urlhandler_activity` VALUES (5,'课堂报到','报到','《软件项目管理》课程 2013年12月16日课堂报到。本课程从大型复杂软件系统开发的根本问题出发，讲解项目管理的基础知识和理论，并结合软件项目管理的特点，介绍有关的概念、技巧、工具和技术，力图使学习者建立软件项目管理的系统化观念，并通过典型案例分析，真正理解和学会运用所学的知识。 本课程的教学内容涉及项目与项目管理、项目组织与人力资源管理、项目论证与评估、项目计划与控制、项目经理的领导力与沟通管理、项目收尾与后评价、项目综合管理、项目管理知识练习等，覆盖整个项目过程的启动、计划、实施、控制、收尾等活动，使学生学会在有限的资源约束下，运用系统的观点、方法和理论，对从投资决策开始到项目结束的全过程进行计划、组织、指挥、协调、控制和评价，从而以最佳的成本效益来实现项目目标。','2013-12-16 21:01:00','2013-12-16 21:50:00','六教6A216','2013-12-16 19:30:00','2013-12-16 21:00:00',2,150,-1,'http://www.xmtxt.com/attachment/Mon_0907/27_11_b3155aee99d79a1.gif',53,NULL),(6,'软件测试','测试','软件测试（英语：software testing），描述一种用来促进鉴定软件的正确性、完整性、安全性和质量的过程。据此，您可能会想，软件测试永远不可能完整的确立任意电脑软件的正确性。然而，在可计算理论（计算机科学的一个支派）一个简单的数学证明推断出下列结果：不可能完全解决所谓“死机”，指任意电脑程序是否会进入死循环，或者罢工并产生输出问题。换句话说，软件测试是一种实际输出与预期输出间的审核或者比较过程。','2013-12-16 20:56:00','2013-12-16 22:20:00','六教6A216','2013-12-16 19:30:00','2013-12-16 20:55:00',2,50,-1,'http://p4.zbjimg.com/task/2011-05/24/776455/4ddb27794477c.jpg',0,NULL),(7,'并发测试','并发','呵呵呵','2013-12-16 20:56:00','2013-12-16 21:50:00','六教6A216','2013-12-16 20:43:00','2013-12-16 20:55:00',2,50,-1,'http://www.baidu.com/img/bdlogo.gif',0,NULL),(8,'软件工程','软件工程','测试','2013-12-18 03:00:00','2013-12-18 04:00:00','六教','2013-12-17 11:10:00','2013-12-18 01:59:00',2,10,-1,'http://a3.att.hudong.com/65/11/01300000329092125324115100343.jpg',5,NULL),(9,'压力测试','压力测试','测试','2013-12-18 16:00:00','2013-12-18 17:00:00','六教','2013-12-18 10:40:00','2013-12-18 11:50:00',2,200,-1,'http://pic1a.nipic.com/2009-02-23/2009223102244483_2.jpg',5,NULL),(10,'12.19测试超长用户名啊啊啊啊啊啊还带英文dfajfljlfjalfjldjdjkfjsjkfjkfjkfjkjfjfkasjfkadjff;djflofoi但啃死到了饭打发老夫烦劳范开 ','测试','测试超长简介：北京大学创办于1898年，初名京师大学堂，是中国第一所国立综合性大学，也是当时中国最高教育行政机关。辛亥革命后，于1912年改为现名。\n作为新文化运动的中心和“五四”运动的策源地，作为中国最早传播马克思主义和民主科学思想的发祥地，作为中国共产党最早的活动基地，北京大学为民族的振兴和解放、国家的建设和发展、社会的文明和进步做出了不可替代的贡献，在中国走向现代化的进程中起到了重要的先锋作用。爱国、进步、民主、科学的传统精神和勤奋、严谨、求实、创新的学风在这里生生不息、代代相传。\n1917年，著名教育家蔡元培出任北京大学校长，他“循思想自由原则，取兼容并包主义”，对北京大学进行了卓有成效的改革，促进了思想解放和学术繁荣。陈独秀、李大钊、毛泽东以及鲁迅、胡适等一批杰出人才都曾在北京大学任职或任教。\n1937年卢沟桥事变后，北京大学与清华大学、南开大学南迁长沙，共同组成长沙临时大学。不久，临时大学又迁到昆明，改称国立西南联合大学。抗日战争胜利后，北京大学于1946年10月在北平复学。\n中华人民共和国成立后，全国高校于1952年进行院系调整，北京大学成为一所以文理基础教学和研究为主的综合性大学，为国家培养了大批人才。据不完全统计，北京大学的校友和教师有400多位两院院士，中国人文社科界有影响的人士相当多也出自北京大学。\n改革开放以来，北京大学进入了一个前所未有的大发展、大建设的新时期，并成为国家“211工程”重点建设的两所大学之一。\n1998年5月4日，北京大学百年校庆之际，国家主席江泽民在庆祝北京大学建校一百周年大会上发表讲话，发出了“为了实现现代化，我国要有若干所具有世界先进水平的一流大学”的号召。在国家的支持下，北京大学适时启动“创建世界一流大学计划”，从此，北京大学的历史翻开了新的一页。\n2000年4月3日，北京大学与原北京医科大学合并，组建了新的北京大学。原北京医科大学的前身是国立北京医学专门学校，创建于1912年10月26日。20世纪三、四十年代，学校一度名为北平大学医学院，并于1946年7月并入北京大学。1952年在全国高校院系调整中，北京大学医学院脱离北京大学，独立为北京医学院。1985年更名为北京医科大学，1996年成为国家首批“211工程”重点支持的医科大学。两校合并进一步拓宽了北京大学的学科结构，为促进医学与人文社会科学及理科的结合，改革医学教育奠定了基础。\n近年来，在“211工程”和“985工程”的支持下，北京大学进入了一个新的历史发展阶段，在学科建设、人才培养、师资队伍建设、教学科研等各方面都取得了显著成绩，为将北大建设成为世界一流大学奠定了坚实的基础。今天的北京大学已经成为国家培养高素质、创造性人才的摇篮、科学研究的前沿和知识创新的重要基地和国际交流的重要桥梁和窗口。\n现任校党委书记朱善璐教授、校长王恩哥院士。带英文Type:\nmake mica2 reinstall mib510,serialport\nwhere serialport is the serial port device name. Under Windows, if your serial port is COMn:, you must use /dev/ttySn-1 as the device name. On Linux, the device name is typically /dev/ttySn for a regular serial port and /dev/ttyUSBn or /dev/usb/tts/n for a USB-serial cable (the name depends on the Linux distribution). Additionally, on Linux, you will typically need to make this serial port world writeable. As superuser, execute the following command:\nchmod 666 serialport\nIf you want to assign a different identifier for each node you have to enter:\nmake mica2 reinstall.ID mib510,serialport\nWhere ID is the identifier you want to give to your mote, for example 0,1,32,...\nIf the installation is successful you should see something like the following (if you don\'t, try repeating the make command):\ncp build/mica2/main.srec build/mica2/main.srec.out\n    installing mica2 binary using mib510\nuisp -dprog=mib510 -dserial=/dev/ttyUSB1 --wr_fuse_h=0xd9 -dpart=ATmega128\n     --wr_fuse_e=ff  --erase --upload if=build/mica2/main.srec.out\nFirmware Version: 2.1\nAtmel AVR ATmega128 is found.\nUploading: flash\n\nFuse High Byte set to 0xd9\n\nFuse Extended Byte set to 0xff\nrm -f build/mica2/main.exe.out build/mica2/main.srec.out','2014-01-01 19:00:00','2014-01-01 20:00:00','大大大大大大大礼堂','2013-12-19 08:15:00','2013-12-19 08:17:00',2,3,-1,'http://news.tsinghua.edu.cn/publish/news/4205/20131218144419739643410/1.jpg',3,NULL),(11,'测试：多个一起抢 ','多个','测试特殊符号︻︼︽︾〒↑↓☉⊙●〇◎¤★☆■▓「」『』◆◇▲△▼▽◣◥◢◣◤ ◥№↑↓→←↘↙Ψ※㊣∑⌒∩【】〖〗＠ξζω□∮〓※》∏卐√ ╳々♀♂∞①ㄨ≡╬╭╮╰╯╱╲ ▂ ▂ ▃ ▄ ▅ ▆ ▇ █ ▂▃▅▆█ ▁▂▃▄▅▆▇█▇▆▅▄▃▂▁+测试大图\n','2014-01-02 01:01:00','2014-01-20 02:02:00','新清华学堂','2013-12-19 08:25:00','2013-12-19 08:50:00',2,5,-1,'http://student.tsinghua.edu.cn/upload/20131214/69711386989219551.jpg',1,NULL),(12,'测试：多个一起抢','多多','测试小图','2014-01-01 01:01:00','2014-01-02 02:02:00','单发力帆矿烦啊滥发空间发','2013-12-19 08:27:00','2013-12-19 08:30:00',2,0,-1,'http://student.tsinghua.edu.cn/css/index/logo.png',0,NULL),(13,'测试长图','长途','据说一定要简介！','2014-01-01 01:01:00','2014-01-02 01:01:00','长常常常常','2013-12-19 08:50:00','2013-12-19 09:00:00',2,0,-1,'http://student.tsinghua.edu.cn/css/index/banner11.jpg',0,NULL),(14,'咔嚓咔嚓咔嚓开开卡卡卡卡卡卡卡卡开咔嚓咔嚓咔嚓卡肯拉范临汾路老夫方框开反馈九分裤烦劳积分飞劳烦烦劳飞咖啡烦劳法兰劳烦劳烦飞法兰劳烦','大家','一起一起琪琪','2014-01-01 00:00:00','2014-01-03 02:04:00','负担啊坟蛋','2013-12-19 08:50:00','2013-12-19 08:55:00',2,3,-1,'http://student.tsinghua.edu.cn/topic/tj2013/tj2013/album/l1.jpg',3,NULL),(15,'一二三四五六七八九十一二三四五六七八九十一二三四五六七八九十一二','数字','测试小图','2014-02-03 02:02:00','2014-02-03 03:03:00','大礼堂','2013-12-19 08:58:00','2013-12-19 09:10:00',2,3,-1,'http://student.tsinghua.edu.cn/css/index/logo0.png',1,NULL),(16,'一二三四五六七八九十一二三四五六七八九十','纳尼','描述','2014-12-12 02:03:00','2014-12-12 02:05:00','大礼堂','2013-12-19 09:03:00','2013-12-19 09:10:00',2,3,-1,'http://student.tsinghua.edu.cn/css/index/logo0.png',2,NULL),(17,'一二三四五六七八九十','哭','FDF啊扥 放大法阿飞','2016-03-01 02:00:00','2017-01-01 04:00:00','一二三四五六七八九十','2013-12-19 09:03:00','2013-12-19 09:05:00',2,3,-1,'http://student.tsinghua.edu.cn/css/index/logo0.png',0,NULL),(18,'一二三四五六七八九十一二三四五','一二三四五六七八九十一二','后天','2014-04-02 02:0